import img_home from '../../assets/home/list_img_home';
import img_ico from '../../assets/ico/list_img_ico';
import './Navbar.css';
import './MobileNavbar.css'

// COMPONENTES
import {Footer} from '../Footer/Footer';

const Navbar = (props) => {

    return(
        <section className='navbar'>
            <div>
                <div className='profile-box'>
                    <div className='profile-picture-box'>
                        <img className='logo-desktop' src={img_home[1].img} alt={img_home[1].alt}></img>
                        <img className='logo-mobile' src={img_ico[10].img} alt={img_home[3].alt}></img>
                    </div>
                    <p>JOSSUE FUENTES</p>
                </div>

                {()=> 1===1 ? <p>fffffffff</p> : <p>hola</p>}

                <nav className='nav-box active-nav-bar'>
                    <ul className='nav'>
                        <li 
                        className={`li ${props.page === 1 ? "active-btn" : null}`}
                        onClick={()=> props.setPage(1)}
                        >Home</li>

                        <li className='li menu-subtitle'>Content</li>

                        <li
                        className={`li ${props.page === 2 ? "active-btn" : null}`}
                        onClick={()=> props.setPage(2)}
                        >Certificates</li>

                        <li
                        className={`li ${props.page === 3 ? "active-btn" : null}`}
                        onClick={()=> props.setPage(3)}
                        >Stacks</li>

                        <li
                        className={`li ${props.page ===4 ? "active-btn" : null}`}
                        onClick={()=> props.setPage(4)}
                        >Portfolio</li>

                        <li
                        className={`li ${props.page ===5 ? "active-btn" : null}`}
                        onClick={()=> props.setPage(5)}
                        >Contactar</li>
                    </ul>
                </nav>
            </div>

            <Footer />
        </section>
    );
};

export {Navbar};
